import { motion } from "framer-motion";

const achievements = [
  "Top 10 finalist in HackTheTrack 2025 üöÑ",
  "Built AI-powered mental health prediction system ü§ñ",
  "Selected in TIF iHub-AWaDH üöÄ",
];

const Achievements = () => (
  <div className="min-h-screen flex flex-col items-center justify-center px-4">
    <h2 className="text-4xl font-bold mb-8">üèÜ My Achievements</h2>
    <ul className="space-y-4 text-lg max-w-xl">
      {achievements.map((ach, idx) => (
        <motion.li
          key={idx}
          className="bg-gray-800 p-4 rounded-xl shadow hover:shadow-lg"
          initial={{ opacity: 0, x: -30 }}
          animate={{ opacity: 1, x: 0 }}
          transition={{ delay: idx * 0.2 }}
        >
          {ach}
        </motion.li>
      ))}
    </ul>
  </div>
);

export default Achievements;
